import React, { useEffect, useState } from 'react';

function App() {
  const [courses, setCourses] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8080/api/courses")
      .then(res => res.json())
      .then(data => setCourses(data));
  }, []);

  return (
    <div>
      <h2>Course List</h2>
      <table border="1">
        <thead>
          <tr><th>Code</th><th>Title</th></tr>
        </thead>
        <tbody>
          {courses.map(c => (
            <tr key={c.id}><td>{c.code}</td><td>{c.title}</td></tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
